          localStorage.setItem("jwt",res.data.token)
          localStorage.setItem("role_id",res.data.role_id)
          localStorage.setItem("company_id",res.data.company_id)
          this.$store.commit("setIsLogin")
          this.$store.commit("setRole1", res.data.role_id)
          flag = true
          if(flag && res.data.role_id==3){
            userName = 'admin1'
            password = 'admin'
            this.handleLogin({ userName, password }).then(res => {
              this.getUserInfo().then(res => {
            // Cookies.set("                                                                                                                                                          ",userName)
                this.$router.push({
                  path: '/home'
                })
              })
            })
          }else if(flag && res.data.role_id==2){
            userName = 'admin'
            password = 'admin'
            this.handleLogin({ userName, password }).then(res => {
              this.getUserInfo().then(res => {
            // Cookies.set("                                                                                                                                                          ",userName)
                this.$router.push({
                  path: '/home'
                })
              })
            })
          }else if(flag && res.data.role_id==1){
            userName = 'superadmin'
            password = 'admin'
            this.handleLogin({ userName, password }).then(res => {
              this.getUserInfo().then(res => {
            // Cookies.set("                                                                                                                                                          ",userName)
                this.$router.push({
                  path: '/home'
                })
              })
            })
          }
        }
        else{
          // console.log('123')
          this.$Message.warning({
            top: 50,
            duration: 4,
            content:'用户名或密码错误'
          })
          load()
        }
      }).catch(res => {
        // console.log('456')
        load()

        //由于长时间未登录后再登陆或首次登陆 服务器会有异常的500码，需要递归再调用一次接口，第二次即可正常登陆
        this.num++
        if (this.num < 2) {
          this.handleSubmit({userName, password})
          return
        }
        // this.$Message.warning({
        //   top: 50,
        //   duration: 4,
        //   content:'网络出现问题请稍后再试'
        // })
      });
    }
  }
}
</script>

